import React from 'react';
import ReactPlayer from 'react-player';
import './YoutubeEmbed.css';

function YouTubeEmbed() {
    return (
        <div className="Player">
            <ReactPlayer
            url="https://www.youtube.com/watch?v=xV7fhBIPFx8"
            controls="on"
            width="300px"
            height="100px" />
        </div>
    );
};

export default YouTubeEmbed
